INSERT INTO `headers` VALUES (63,47,'Products',1,'<p>Test</p>','2020-08-28 21:45:18','2020-08-28 21:46:43',0,'booth'),(64,47,'Sales',1,NULL,'2020-08-28 21:45:22','2020-08-28 21:45:22',1,'booth'),(65,30,'Dogs',1,'<p>T1</p>','2020-08-28 22:09:48','2020-08-28 22:10:02',0,'poster'),(66,31,'Area',1,NULL,'2020-08-29 05:23:11','2020-08-29 05:23:11',0,'poster'),(67,48,'Page Item',1,NULL,'2020-09-02 18:19:42','2020-09-02 18:19:42',0,'booth'),(68,49,'menu1',1,NULL,'2020-09-03 01:05:14','2020-09-03 01:05:36',0,'booth'),(69,49,'menu2',1,NULL,'2020-09-03 01:05:21','2020-09-03 01:05:36',1,'booth'),(70,49,'menu3',1,NULL,'2020-09-03 01:05:28','2020-09-03 01:05:36',2,'booth'),(71,50,'menu2',1,NULL,'2020-09-03 01:09:44','2020-09-03 01:09:44',0,'booth'),(72,32,'Products',1,NULL,'2020-09-03 15:20:34','2020-09-03 15:20:34',0,'poster'),(73,51,'Marias Dogs',1,NULL,'2020-09-03 19:33:53','2020-09-03 19:33:53',0,'booth'),(74,32,'Sales',1,NULL,'2020-09-08 20:20:44','2020-09-08 20:20:44',1,'poster'),(75,35,'Products',1,NULL,'2020-09-08 22:12:52','2020-09-08 22:12:52',0,'poster'),(76,56,'Female Life Expectancy Trends for U.S. States and 16 Peer Countries, 1965-2016',1,NULL,'2020-09-09 21:41:19','2020-09-21 17:23:41',0,'poster'),(77,53,'Test Page Area',1,NULL,'2020-09-09 21:51:36','2020-09-09 21:51:36',0,'booth'),(81,99,'Background',1,'<p><strong style=\"color: rgb(247, 79, 111);\">A: </strong><span style=\"color: black;\">Research is beginning to identify the current physical activity (PA) patterns and trends of children during out-of-school time (OST); however, children living in rural communities remain an understudied population.</span></p><p><strong style=\"color: rgb(0, 112, 192);\">B: </strong><span style=\"color: black;\">Given their high demand, extensive reach, and contact time, OST programs (OSTPs), like afterschool programs (ASPs), have the potential to reduce children’s health disparities by increasing PA.</span></p><p><strong style=\"color: rgb(0, 176, 80);\">C: </strong><span style=\"color: black;\">With the dire need for children to increase their current levels of PA and to better support the implementation of PA interventions in OSTPs, the </span><strong style=\"color: black;\">purpose</strong><span style=\"color: black;\"> of this secondary data-analysis is to examine demographic factors associated with OST PA among rural children.&nbsp;</span></p><p><span style=\"color: black;\">Although many U.S. children are not meeting the recommended PA guidelines, we hypothesize children participating in OSTPs will be more active than their non-participating peers, even if the program’s primary purpose is not PA-related.</span></p>','2020-09-11 20:51:06','2020-09-11 20:57:35',0,'poster'),(82,99,'Methods and Participant Characteristics',1,NULL,'2020-09-11 20:54:09','2020-09-11 20:56:05',1,'poster'),(83,99,'Results',1,NULL,'2020-09-11 20:54:20','2020-09-11 20:54:20',2,'poster'),(84,99,'Results',1,NULL,'2020-09-11 20:54:32','2020-09-11 20:54:32',3,'poster'),(85,99,'Conclusion and Future Directions',1,NULL,'2020-09-11 20:55:05','2020-09-11 20:55:05',4,'poster'),(86,99,'Funding Acknowledgement',1,NULL,'2020-09-11 20:55:23','2020-09-11 20:55:23',5,'poster'),(94,50,'Poster Details',1,'<p><span style=\"color: rgb(53, 53, 53);\">Describe whether participation in a school-based early childhood program model, Child-Parent Centers program (CPC), is associated with reduced CJS involvement in a sample of children (ages 3-5) followed thru age 27. CPC provides preschool education and comprehensive family support services to children from low-income families.</span><sup style=\"color: rgb(0, 0, 0);\">8</sup></p>','2020-09-18 16:31:14','2020-09-20 22:23:28',1,'poster'),(101,118,'Contact',1,'<p>Please contact Coralia Balasca (Balasca.1@osu.edu) with questions, suggestions, etc. </p>','2020-09-18 19:03:09','2020-09-18 19:04:52',0,'poster'),(109,132,'Authors',1,'<p>Joseph Ayoub, Justin Brill, Jacquelyn Ho, Abigail Jones, Katherine Pattee, Pooja Varman, Koree Willer</p><p>	Creighton University School of Medicine</p><p>Claire Baweja</p><p>	University of Nebraska Medical Center</p><p><br></p>','2020-09-18 19:57:54','2020-09-18 20:03:24',1,'poster'),(110,132,'Contact Us',1,'<p><strong style=\"color: rgb(64, 64, 64);\">website: </strong><a href=\"https://dojusticedouglasco.wixsite.com/dojustice\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\"><strong>https://dojusticedouglasco.wixsite.com/dojustice</strong></a><strong style=\"color: rgb(64, 64, 64);\">&nbsp;</strong></p><p><strong style=\"color: rgb(64, 64, 64);\">email: dojustice.douglascounty@gmail.com<span class=\"ql-cursor\">﻿</span></strong></p><p><br></p>','2020-09-18 20:04:42','2020-09-18 20:05:40',1,'poster'),(111,139,'Page Demo',1,NULL,'2020-09-19 02:48:58','2020-09-19 02:48:58',0,'poster'),(112,139,'Resources',1,NULL,'2020-09-19 02:49:07','2020-09-19 02:49:07',1,'poster'),(113,139,'Info',1,NULL,'2020-09-19 02:50:04','2020-09-19 02:50:04',2,'poster'),(116,139,'Test Page',1,NULL,'2020-09-20 02:04:55','2020-09-20 02:04:55',3,'poster'),(117,139,'2',1,NULL,'2020-09-20 02:06:01','2020-09-20 02:06:01',4,'poster'),(126,98,'Overview',1,NULL,'2020-09-20 16:57:39','2020-09-20 16:57:39',0,'poster'),(127,98,'Introduction',1,NULL,'2020-09-20 16:57:52','2020-09-20 16:57:52',1,'poster'),(128,98,'Methods',1,NULL,'2020-09-20 17:06:50','2020-09-20 17:06:50',2,'poster'),(131,144,'X',1,'<p><img src=\"data:image/jpeg;base64,\"></p>','2020-09-20 17:59:59','2020-09-20 18:03:15',0,'poster'),(132,145,'DEMO PAGE',1,NULL,'2020-09-20 19:25:55','2020-09-20 19:25:55',0,'poster'),(133,85,'Video Presentation',1,NULL,'2020-09-20 20:37:51','2020-09-20 20:45:44',0,'poster'),(134,85,'Poster',1,NULL,'2020-09-20 20:45:25','2020-09-20 20:45:25',1,'poster'),(135,85,'References',1,NULL,'2020-09-20 20:45:53','2020-09-20 20:45:53',2,'poster'),(136,122,'Podcast about Poster',1,NULL,'2020-09-21 15:20:19','2020-09-22 01:26:42',0,'poster'),(139,157,'Contact',1,'<p>Twitter: <a href=\"twitter.com/alinzar\" rel=\"noopener noreferrer\" target=\"_blank\">@alinzar</a></p><p>Website: <a href=\"evangelinewarren.com\" rel=\"noopener noreferrer\" target=\"_blank\">evangelinewarren.com</a></p><p>Email: warren.651@osu.edu</p>','2020-09-21 21:37:53','2020-09-22 01:29:09',0,'poster'),(143,39,'Contacts',1,'<p>Christal Hamilton</p><p>University of Missouri,&nbsp;</p><p><a href=\"mailto:chamilton@mail.missouri.edu\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">chamilton@mail.missouri.edu</a></p><p><br></p>','2020-09-21 22:46:37','2020-09-22 13:30:08',0,'poster'),(144,159,'Contact',1,'<p>Christal Hamilton</p><p>University of Missouri</p><p>chamilton@mail.missouri.edu</p>','2020-09-21 23:02:48','2020-09-21 23:25:40',0,'poster'),(147,57,'Full Poster',1,NULL,'2020-09-22 00:04:55','2020-09-22 00:04:55',0,'poster'),(150,47,'Background',1,'<p>This is a photo of our research team in after gathering at Gynocare Women\'s and Fistula Hospital in Eldoret, Kenya. This picture was taken at the end of a two day team workshop where we discussed final adjustments to research tools and practiced methods.</p><p><br></p><p><img src=\"data:image/png;base64,\"></p>','2020-09-22 11:55:38','2020-09-22 16:40:49',2,'poster'),(151,47,'Research Questions',1,NULL,'2020-09-22 11:55:57','2020-09-22 11:55:57',3,'poster'),(152,47,'Methods',1,NULL,'2020-09-22 11:56:04','2020-09-22 11:56:04',4,'poster'),(153,47,'Prominent Themes',1,NULL,'2020-09-22 11:56:25','2020-09-22 11:56:25',5,'poster'),(154,47,'Findings and Future Directions',1,NULL,'2020-09-22 11:56:40','2020-09-22 11:56:40',6,'poster'),(155,47,'Limitations',1,NULL,'2020-09-22 11:56:49','2020-09-22 11:56:58',7,'poster'),(157,78,'More Information',1,NULL,'2020-09-22 18:20:05','2020-09-22 18:20:05',0,'poster'),(159,72,'Abstract',1,'<p>Area-level factors are understudied in systemic lupus erythematosus (SLE). We used data from the Black Women\'s Experiences Living with Lupus (BeWELL) Study to identify unique latent profiles of census tract characteristics and examine associations with risk factors for heightened SLE activity among 438 Black women living in 257 metropolitan Atlanta, GA census tracts. Structural equation models indicate racially segregated, predominately Black, and mid-to-low SES census tracts are risk factors for elevated disease activity through increased perceived neighborhood disorder and depression. Structural racism and racial residential segregation shape physical and social neighborhood factors which may in part drive inequitable SLE outcomes for Black women. Interventions which address structural racism, including racial residential segregation, concentrated poverty, and neighborhood disorder, may reduce racial SLE disparities and promote health&nbsp;equity.</p><p><br></p><p>Highlights: </p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Latent profile analysis identified four unique census tract profiles in the sample</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Profile associations with lupus activity differed by tract SES &amp; racial composition</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Perceived neighborhood disorder and depression may mediate this relationship</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Structural racism and neighborhood factors may promote racial disparities in lupus</p>','2020-09-22 20:52:16','2020-09-22 20:58:46',0,'poster'),(160,107,'Stress-Response Dysregulation and Cardiometabolic Health in Mixed-Status Immigrant Families',1,NULL,'2020-09-22 21:35:19','2020-09-22 21:42:07',0,'poster'),(161,53,'Main poster',1,NULL,'2020-09-22 23:48:47','2020-09-22 23:48:47',1,'poster'),(162,53,'Supplemental material',1,NULL,'2020-09-22 23:53:40','2020-09-22 23:53:40',2,'poster'),(164,69,'Poster Assets',1,NULL,'2020-09-24 15:41:25','2020-09-24 15:41:25',0,'poster'),(165,68,'Test Page Title',1,NULL,'2020-09-25 17:09:03','2020-09-25 17:09:03',0,'booth'),(166,69,'Menu Item',1,NULL,'2020-09-25 17:14:08','2020-09-25 17:14:08',1,'booth'),(167,72,'Add Health in a Nutshell',1,'<p>Click here to access the following Add Health Presentation: <a href=\"https://addhealth.cpc.unc.edu/wp-content/uploads/docs/user_guides/Overview_of_Ancillary_Study_Applications_Adding_Supplemental_Data_to_Add_Health_Hummer.pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Adding Supplemental Data to Add Health</a></p>','2020-09-25 19:14:58','2020-09-25 19:48:58',1,'booth'),(168,72,'Poster: Data Management, Dissemination, and Linkage in Add Health',1,NULL,'2020-09-25 19:17:55','2020-09-25 19:23:03',2,'booth');
INSERT INTO `headers` VALUES (169,72,'Add Health Brochure',1,'<p><img src=\"data:image/png;base64,\"></p><p><img src=\"data:image/png;base64,\"></p>','2020-09-25 19:19:18','2020-09-25 19:40:09',3,'booth');
INSERT INTO `headers` VALUES (170,72,'Add Health New Data Releases (2020)',1,'<p><strong><u>Add Health New Data Releases</u></strong></p><p><br></p><p>Add Health is accepting requests for the Wave V data from users with current restricted-use data contracts. To apply, renew, or access the Add Health restricted data visit the <a href=\"https://data.cpc.unc.edu/projects/2/view\" rel=\"noopener noreferrer\" target=\"_blank\">CPC Data Portal</a>. </p><p>Public-use data for Wave V will be available in December 2020.&nbsp;</p><p><br></p><p>Add Health is excited to announce the release of the following new data files, available for Add Health restricted-use data&nbsp;contract researchers.</p><p><br></p><p class=\"ql-indent-1\"><strong>Wave V Demographics – Home Exam</strong></p><p class=\"ql-indent-1\">These files contain various demographic variables in regards to the Wave V home exam, including the date of the home exam, number of days between the Wave V survey and the home exam. It also includes the home exam completion status, as well as the respondent’s age, biological sex, pregnancy status, medication use and blood draw status.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Glucose Homeostasis</strong></p><p class=\"ql-indent-1\">This file contains assay results of glucose and hemoglobin A1c (HbA1c) based on venous blood collected via phlebotomy at the Wave V home exam. There are classifications for fasting glucose and non-fasting glucose, as well as an HbA1C classification. Other variables included are flags based on a self-reported diabetes medical history, anti-diabetic medication use, and a diabetes joint classification variable.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Lipids</strong></p><p class=\"ql-indent-1\">The Wave V lipids file contains constructed measures designed to facilitate analysis and interpretation of lipids results based on venous blood collected via phlebotomy at the Wave V home exam. In addition to the lipid assay results, there are classifications according to both the NCEP/ATP III and AHA/ACC guidelines, a flag for antihyperlipidemic medication use, and two hyperlipidemia joint classification variables.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Renal Function</strong></p><p class=\"ql-indent-1\">This file contains constructed measures designed to facilitate analysis and interpretation of renal function based on venous blood collected via phlebotomy at the Wave V home exam. Assay results for creatinine and cystatin-c are available, as well as three different estimations of the glomerular filtration rate (GFR) using either the creatinine concentration, the cystatin C concentration or both concentrations. Classifications according to both clinical and KDIGO guidelines are available as well.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Inflammation and Immune Function</strong></p><p class=\"ql-indent-1\">These files include constructed measures designed to facilitate analysis and interpretation of inflammation and immune function based on venous blood collected via phlebotomy at the Wave V home exam. In addition to the assay results for high sensitivity C-reactive protein (hsCRP), there is an AHA/CDC classification, counts of subclinical symptoms and common infectious or inflammatory diseases, and various anti-inflammatory medication use flags.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Biomarker Weight</strong></p><p class=\"ql-indent-1\">This file contains the Wave V biomarker sample weight.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Sample 2B</strong></p><p class=\"ql-indent-1\">Sample S2B is part of the Wave V survey. S2B was administered 2 June 2017-8 July 2018. While most variables were released in December 2019 as Wave V data, two sections were not. These specifically S2B cases are a representative sample (asked of everyone in the sample). Web survey content for the other samples (1, 2A, 3) were edited mid-data collection and not all respondents in each sample had the opportunity to answer the questions.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave V Constructed Age</strong></p><p class=\"ql-indent-1\">The Wave V survey did not ask respondent age though it is possible to calculate age using interview date and date of birth. For deductive disclosure reasons complete interview dates and dates of birth were collected but not released. To provide calculated ages two variables have been constructed based on complete interview dates and date of birth month/year and 15 as a universal assigned day of birth.</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><strong>Wave IV Polygenic Scores – Release 2</strong></p><p class=\"ql-indent-1\">Seventy-four constructed polygenic scores (PGSs) are available for Add Health respondents who provided archival saliva samples for genetic testing at Wave IV. Scores are available for various anthropomorphic, health, and behavioral outcomes. See the documentation for a list of all PGSs.</p><p><br></p><p><br></p>','2020-09-25 19:22:21','2020-09-25 19:35:53',4,'booth'),(171,72,'Guidelines for Analyzing Add Health Data',1,NULL,'2020-09-25 19:24:45','2020-09-25 19:24:45',5,'booth'),(172,72,'Add Health Study: Design and Accomplishments',1,'<p>Click here to access the following Add Health User Guide: <a href=\"https://addhealth.cpc.unc.edu/wp-content/uploads/docs/user_guides/DesignPaperWave_I-IV.pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Add Health Study - Design and Accomplishments</a></p>','2020-09-25 19:25:16','2020-09-25 19:48:06',6,'booth'),(173,72,'Presentation: Adding Supplemental Data to Add Health',1,NULL,'2020-09-25 19:26:03','2020-09-25 19:26:03',7,'booth'),(174,54,'Test',1,'<p>Test</p>','2020-09-26 00:00:30','2020-09-26 00:00:46',0,'booth'),(175,178,'Poster Menu Header',1,NULL,'2020-09-26 00:09:03','2020-09-26 00:09:03',0,'poster'),(176,75,'Test Page',1,'<p>another test text box!</p>','2020-09-26 00:11:26','2020-09-26 03:39:30',0,'booth');
