:8,\"boxShadow\":true,\"hasBg\":false,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',1996,'2020-09-08 22:39:05','2020-09-25 23:05:48','1937474196.png',NULL,NULL,'P355',0),(48,33,49,'University of Michigan','1',NULL,1,'{\"bg\":\"#322b91\",\"height\":32,\"btn\":{\"bg\":\"#d683ce\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',1997,'2020-09-08 22:39:05','2020-09-24 23:16:19','1470926398.png',NULL,NULL,'P287',0),(49,33,48,'University of Kwazulu-Natal, Durban',NULL,NULL,1,NULL,1998,'2020-09-08 22:39:05','2020-09-08 22:39:05',NULL,NULL,NULL,'P354',0),(50,33,50,'Association between CPC Preschool Attendance and Criminal Justice System Involvement','1',NULL,1,'{\"bg\":\"#ffffff\",\"height\":32,\"btn\":{\"bg\":\"#fefcfb\",\"color\":\"#713838\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":false,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',1999,'2020-09-08 22:39:05','2020-09-24 23:16:25','1338241848.png','[{\"title\":\"Background\",\"text\":\"Black and Latinx Americans are disproportionately impacted by the criminal justice system (CJS) due to structural racism. For example, African American males make up approximately 50% of the United States\\u2019 (US) prison population, despite making up only 6% of the general US population.1 Research suggests CJS involvement, either direct (e.g., serving time in prison) or indirect (e.g., family member serving time in prison), is associated with poorer education outcomes, fewer employment opportunities, poor mental health outcomes, and changes in family relationships.1\\u20135 \\n\\nPrevious studies have suggested that numerous family and peer characteristics such as parental supervision, peer substance use, and academic achievement alter the risk of criminal justice involvement.6,7 High-quality early childhood education is known to increase academic achievement and employment, but few studies have examined its relationship to criminal justice involvement from adolescence through early adulthood.\",\"position\":{\"x\":\"0\",\"y\":\"11\",\"ex\":\"34\",\"ey\":\"57\"},\"bg\":\"#e9dddd\",\"padding\":\"0\",\"zIndex\":\"0\",\"type\":\"text\",\"borderRadius\":\"2\",\"header\":{\"color\":\"#000000\",\"size\":\"19\"},\"body\":{\"color\":\"#000000\",\"size\":\"11\",\"bg\":\"#e9dddd\",\"borderRadius\":\"2\",\"padding\":8,\"position\":{\"x\":\"0\",\"y\":\"-3\",\"ex\":\"100\",\"ey\":\"94\"}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}},{\"title\":\"By: Cynthia Pando, MA, Jeungeun May Seo, MPH, Jaime Slaughter-Acey, PhD, Ellen Demerath, PhD;  University of Minnesota\",\"text\":\"\",\"position\":{\"x\":\"0\",\"y\":\"5\",\"ex\":\"100\",\"ey\":\"11\"},\"bg\":\"#d8c5c5\",\"padding\":\"5\",\"zIndex\":\"0\",\"type\":\"text\",\"borderRadius\":\"2\",\"header\":{\"color\":\"#000000\",\"size\":\"19\"},\"body\":{\"color\":\"#000000\",\"size\":\"12\",\"bg\":\"#d8c5c5\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":\"96\",\"y\":\"8\",\"ex\":100,\"ey\":\"-3\"}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}},{\"title\":\"Objective\",\"text\":\"Describe whether participation in a school-based early childhood program model, Child-Parent Centers program (CPC), is associated with reduced CJS involvement in a sample of children (ages 3-5) followed thru age 27. CPC provides preschool education and comprehensive family support services to children from low-income families.8 \",\"position\":{\"x\":\"0\",\"y\":\"53\",\"ex\":\"34\",\"ey\":\"100\"},\"bg\":\"#e9dddd\",\"padding\":\"7\",\"zIndex\":0,\"type\":\"text\",\"borderRadius\":\"2\",\"header\":{\"color\":\"#000000\",\"size\":\"19\"},\"body\":{\"color\":\"#090101\",\"size\":\"11\",\"bg\":\"#e9dddd\",\"borderRadius\":\"2\",\"padding\":\"8\",\"position\":{\"x\":\"-2\",\"y\":\"-3\",\"ex\":\"102\",\"ey\":\"91\"}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}},{\"title\":\"Tables\",\"text\":\"\",\"position\":{\"x\":\"34\",\"y\":\"11\",\"ex\":\"73\",\"ey\":\"100\"},\"bg\":\"#e9dddd\",\"padding\":8,\"zIndex\":0,\"type\":\"media\",\"borderRadius\":\"2\",\"header\":{\"color\":\"#000000\",\"size\":\"20\"},\"body\":{\"color\":\"#000000\",\"size\":16,\"bg\":\"#ffffff\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":\"2\",\"padding\":8,\"bg\":\"#e9dddd\",\"position\":{\"x\":\"-2\",\"y\":\"-8\",\"ex\":\"79\",\"ey\":\"66\"},\"file\":\"345315741.png\"}},{\"title\":\"Results\",\"text\":\"Table 1 presents our analytic sample comprised of 1,465 participants: 64%- attended CPC, 50% -male, 78%- at least a high school education, and 93% -Black. There are crude differences in CSJ involvement by CPC enrollment status. Generally, respondents enrolled in CPC had lower levels of CSJ involvement compared to respondents who were not enrolled in CPC. \\n\\nTable 2 presents the results of regression models with increasing covariate adjustment. In fully adjusted models, CPC participation was associated with a 30-40% lower odds of juvenile delinquencies, violent offenses, and felony charges. For example, the risk of ever being incarcerated or jailed was reduced by nearly a third (28%) in those who had attended CPC preschool compared with those who had not attended CPC preschool (p-value: 0.02, 95% CI: 0.54, 0.95). Participants of CPC preschool programs were at a 53% lower risk of having their first arrest in childhood (between 0 and 12 years: p-value: 0.01, 95% CI: 0.28, 0.80). CPC-enrolled respondents also had a lower risk of the first arrest during adolescence (18% lower risk) and young adulthood (19% lower risk) compared to non-CPC enrolled respondents, although covariate adjustment attenuated these effects slightly and the confidence limits included 1.0. \",\"position\":{\"x\":\"71\",\"y\":\"11\",\"ex\":\"100\",\"ey\":\"66\"},\"bg\":\"#e9dddd\",\"padding\":8,\"zIndex\":0,\"type\":\"text\",\"borderRadius\":\"2\",\"header\":{\"color\":\"#000000\",\"size\":\"19\"},\"body\":{\"color\":\"#000000\",\"size\":\"10\",\"bg\":\"#e9dddd\",\"borderRadius\":\"2\",\"padding\":\"8\",\"position\":{\"x\":\"-4\",\"y\":\"-3\",\"ex\":\"102\",\"ey\":\"99\"}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}},{\"title\":\"Conclusion\\/Implications\",\"text\":\" Participation in school-based early-childhood education and family support programs for preschool-age children, 3 to 5 years old, may serve as a protective factor against future interactions with the CJS. This was shown in a predominantly African American study sample, which is important given the disproportionate incarceration of Black men in the United States. Although school-based early-childhood education and family support programs appear as a protective factor, it is critical to understand the mechanisms by which these programs may benefit children and how to make them more available to populations of color. It is also important to explore other protective factors that will help decrease involvement with the CJS system, including advocating for the dismantling of structural racism across all institutions. \",\"position\":{\"x\":\"70\",\"y\":\"66\",\"ex\":\"100\",\"ey\":\"93\"},\"bg\":\"#e9dddd\",\"padding\":8,\"zIndex\":0,\"type\":\"text\",\"borderRadius\":\"2\",\"header\":{\"color\":\"#000000\",\"size\":\"15\"},\"body\":{\"color\":\"#000000\",\"size\":\"9\",\"bg\":\"#e9dddd\",\"borderRadius\":\"2\",\"padding\":\"8\",\"position\":{\"x\":\"-1\",\"y\":\"-4\",\"ex\":\"101\",\"ey\":\"126\"}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}}]','{\"position\":{\"x\":\"0\",\"y\":\"0\",\"ex\":\"100\",\"ey\":\"5\"},\"bg\":\"#d8c5c5\",\"text\":{\"color\":\"#121111\",\"size\":\"20\"}}','P172',0),(51,33,44,'University of Minnesota School of Public Health',NULL,NULL,1,NULL,2000,'2020-09-08 22:39:05','2020-09-08 22:39:05',NULL,NULL,NULL,'P144',0),(52,33,51,'Long-term construction may be associated with negative health outcomes','1',NULL,1,NULL,2001,'2020-09-08 22:39:06','2020-09-24 23:31:20','1267476670.png',NULL,NULL,'P9',0),(53,33,49,'University of Utah','1',NULL,1,NULL,2002,'2020-09-08 22:39:06','2020-09-24 23:16:28','981401627.png',NULL,NULL,'P285',0),(54,33,43,'A Web-Based Screener for Mild Cognitive Impairment','1',NULL,1,NULL,2003,'2020-09-08 22:39:06','2020-09-24 23:31:22','1980829695.png',NULL,NULL,'P234',0),(55,33,48,'UNC-Chapel Hill','1',NULL,1,NULL,2004,'2020-09-08 22:39:06','2020-09-24 23:31:25','1984644379.png',NULL,NULL,'P357',0),(56,33,52,'University of Colorado Boulder','1',NULL,1,NULL,2005,'2020-09-08 22:39:07','2020-09-24 23:31:28','1360724438.png',NULL,NULL,'P251',0),(57,33,38,'University of California, Irvine','1',NULL,1,'{\"bg\":\"#0064a4\",\"height\":32,\"btn\":{\"bg\":\"#ffd200\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',2006,'2020-09-08 22:39:07','2020-09-24 23:31:30','691722049.png',NULL,NULL,'P372',0),(58,33,53,'University of Missouri','1',NULL,1,NULL,2007,'2020-09-08 22:39:07','2020-09-24 23:31:33','1783099783.png',NULL,NULL,'P61',0),(60,33,40,'University of Texas at Austin','1',NULL,1,NULL,2009,'2020-09-08 22:39:07','2020-09-24 23:31:39','1801059459.png',NULL,NULL,'P98',0),(61,33,54,'Food insecurity and type 2 diabetes among Latinos: Examining neighborhood cohesion as a protective factor','1',NULL,1,'{\"bg\":\"#922c88\",\"height\":32,\"btn\":{\"bg\":\"#d683ce\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',2010,'2020-09-08 22:39:08','2020-09-24 23:31:42','933621475.png',NULL,NULL,'P385',0),