"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}},{\"title\":\"\",\"text\":\"\",\"position\":{\"x\":1,\"y\":11,\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":8,\"zIndex\":0,\"type\":\"media\",\"borderRadius\":8,\"header\":{\"color\":\"#000000\",\"size\":24},\"body\":{\"color\":\"#000000\",\"size\":16,\"bg\":\"#ffffff\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"206165899.png\"}}]','{\"position\":{\"x\":1,\"y\":1,\"ex\":28,\"ey\":10},\"bg\":\"#ffffff\",\"text\":{\"color\":\"#000000\",\"size\":28}}','P320',0),(115,33,44,'University of Missouri','1',NULL,2,NULL,2063,'2020-09-08 22:44:34','2020-09-24 13:38:58','1837504659.',NULL,NULL,'P142',0),(116,33,62,'School of Public Health, University of Michigan','1',NULL,1,'{\"bg\":\"#2b3791\",\"height\":32,\"btn\":{\"bg\":\"#9998e1\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',2064,'2020-09-08 22:44:35','2020-09-25 23:50:21','1305325777.png',NULL,NULL,'P261',0),(117,33,62,'UNC Chapel Hill','1',NULL,2,NULL,1992,'2020-09-08 22:44:35','2020-09-24 13:41:13','111237500.png',NULL,NULL,'P262',0),(118,33,39,'The Ohio State University','1',NULL,1,'{\"bg\":\"#1c1c1c\",\"height\":32,\"btn\":{\"bg\":\"#d683ce\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',2065,'2020-09-08 22:44:35','2020-09-25 23:51:28','2119602352.png',NULL,NULL,'P242',0),(119,33,49,'Individual and neighborhood-level relative income in relation to past-year mental disorders in five cities in Latin America','1',NULL,2,'{\"bg\":\"#000000\",\"height\":32,\"btn\":{\"bg\":\"#d683ce\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',2066,'2020-09-08 22:44:35','2020-09-26 15:57:47','455495512.png','[{\"title\":\"\",\"text\":\"Latin America is a rapidly urbanizing area with high levels of income inequality. \\nNeighborhood-level relative income has been shown to be associated with mental disorders in other regions, but is rarely studied in urban areas of Latin America. \\nOur objective was to assess whether neighborhood-level income was associated with individual past-year mental health disorders in five large cities in Latin America.\",\"position\":{\"x\":1,\"y\":11,\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":8,\"zIndex\":0,\"type\":\"text\",\"borderRadius\":8,\"header\":{\"color\":\"#000000\",\"size\":24},\"body\":{\"color\":\"#000000\",\"size\":16,\"bg\":\"#ffffff\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"1784865249.pdf\"}},{\"title\":\"\",\"text\":\"Data were from the World Mental Health Survey Initiative in Medell\\u00edn, Colombia; S\\u00e3o Paulo, Brazil; Lima, Peru; Buenos Aires, Argentina; and Mexico City, Mexico (n=7,259 adults). \\nNeighborhood-level relative income was calculated as the ratio between weighted mean neighborhood income and weighted mean city income, then tertiled.\\nOutcomes were grouped into past-year internalizing (mood and anxiety) and externalizing (behavioral and substance use) disorders. \\nWeighted, multivariable, multilevel logistic models were run, adjusting for city, age, sex, individual relative income, education, marital status, employment status, and a random intercept varying at the neighborhood level.\",\"position\":{\"x\":1,\"y\":11,\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":8,\"zIndex\":0,\"type\":\"text\",\"borderRadius\":8,\"header\":{\"color\":\"#000000\",\"size\":24},\"body\":{\"color\":\"#000000\",\"size\":16,\"bg\":\"#ffffff\",\"borderRadius\":8,\"padding\":8,\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}}]','{\"position\":{\"x\":1,\"y\":1,\"ex\":99,\"ey\":10},\"bg\":\"#ffffff\",\"text\":{\"color\":\"#000000\",\"size\":36}}','P284',0),(120,33,42,'Vanderbilt University','1',NULL,1,NULL,2067,'2020-09-08 22:44:35','2020-09-25 23:52:24','1145662823.png',NULL,NULL,'P321',0),(121,33,50,'Healthy Spaces: Promoting Healthy and Resilient Communities','1',NULL,1,NULL,2068,'2020-09-08 22:44:35','2020-09-25 23:52:49','2085017132.png',NULL,NULL,'P174',0),(122,33,40,'Describing the Populations Depicted in Health Insurance Ads','1',NULL,1,'{\"bg\":\"#ffffff\",\"height\":32,\"btn\":{\"bg\":\"#faf9fa\",\"color\":\"#0f0f0f\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',2069,'2020-09-08 22:44:36','2020-09-25 23:14:11','327076405.png','[{\"title\":\"Background\",\"text\":\"Media play a complex role in shaping public understanding of health and social policy. Health insurance ads are one form of media that provide information to the public \\nabout health insurance (Fowler, et al, 2017) and subsequently, ideas of who deserves access. Insurance ads include visuals of individuals that may provide cues to the public about the populations currently or potentially benefitting from or deserving of health insurance. In health policy, public programs generally target groups such as the elderly, pregnant women, and children, who are perceived by the public as deserving (Gollust and Lynch, 2011; Schneider and Ingram, 1993) \\nHealth insurance ads are diverse in their objectives and content, though, and these differences motivate analyses of the different populations depicted and how these vary by the type of insurance product that is being marketed. We address these questions in this research:\\n(1) Do the populations depicted in ads differ when comparing ads for Medicaid plans versus non-Medicaid plans? \\n(2) Are ads for Medicaid plans more likely to include depictions of certain population groups deemed deserving of social policy benefits? \",\"position\":{\"x\":\"1\",\"y\":\"12\",\"ex\":33,\"ey\":99},\"bg\":\"#ffffff\",\"padding\":\"8\",\"zIndex\":\"0\",\"type\":\"text\",\"borderRadius\":\"8\",\"header\":{\"color\":\"#000000\",\"size\":\"18\"},\"body\":{\"color\":\"#000000\",\"size\":\"13\",\"bg\":\"#ffffff\",\"borderRadius\":\"-3\",\"padding\":\"5\",\"position\":{\"x\":0,\"y\":0,\"ex\":\"100\",\"ey\":\"93\"}},\"media\":{\"borderRadius\":8,\"padding\":8,\"bg\":\"#ffffff\",\"position\":{\"x\":0,\"y\":0,\"ex\":100,\"ey\":100},\"file\":\"\"}}]','{\"position\":{\"x\":1,\"y\":1,\"ex\":99,\"ey\":10},\"bg\":\"#ffffff\",\"text\":{\"color\":\"#000000\",\"size\":\"27\"}}','P95',0),(123,33,40,'Support for Whole-Person Cancer Care: Assessing Health-Related Social Needs among Patients with Cancer','1',NULL,2,'{\"bg\":\"#922c88\",\"height\":\"20\",\"btn\":{\"bg\":\"#d683ce\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',2057,'2020-09-09 19:17:30','2020-09-20 18:34:30','326820418.jpg',NULL,NULL,NULL,0),(124,33,NULL,'Whose cigarette smoking behavior is most affected by the Philippine Sin Tax Reform Act?','1',NULL,1,'{\"bg\":\"#922c88\",\"height\":32,\"btn\":{\"bg\":\"#d683ce\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13,\"paddingX\":2,\"paddingY\":8}}',2041,'2020-09-10 04:05:10','2020-09-10 04:08:59','2024359331.pdf',NULL,NULL,NULL,0),(125,33,48,'The relationship between female genital cutting and recent sexual activity in Nigeria','3',NULL,2,'{\"bg\":\"#922c88\",\"height\":32,\"btn\":{\"bg\":\"#d683ce\",\"color\":\"#ffffff\",\"radius\":4,\"space\":8,\"boxShadow\":true,\"hasBg\":true,\"fontSize\":13